    false,nt"url": null,nt"notes": "An orthoimage is remotely sensed image
    data in which displacement of features in the image caused by terrain relief and
    sensor orientation has been mathematically removed. Orthoimagery combines the image
    characteristics of a photograph with the geometric qualities of a map. For this
    dataset, 2-foot pixel resolution natural color digital orthimages were obtained
    from the West Virginia Statewide Addressing and Mapping Board. The orthoimages were
    mosaicked and reprojected by the USGS from the original 2-foot pixel, West Virginia
    North and South State Plane (feet) Coordinate Systems to Universal Transverse Mercator
    (UTM) (meters), Zone 17, NAD83 datum. Each orthoimage (DOQQ) provides the equivalent
    to a quarter of a 7.5-minute map (3.75 minutes of latitude and longitude) with overedge.
    The overedge is approximately 300 meters beyond the extremes of the corners of coverage.
    The naming convention is based on the U.S. Geological Survey 1:24,000 Topographic
    Map Series with the quadrant abbreviation, i.e. athens_ne.tif, etc. This data set
    covers the entire state of West Virginia including into UTM zone 17 on the east
    edge.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
